package org.apache.commons.configuration2;

import org.apache.commons.configuration2.io.FileHandler;
import org.apache.commons.configuration2.BaseHierarchicalConfiguration;
import org.apache.commons.configuration2.ex.ConfigurationException;
import org.apache.commons.configuration2.io.FileBased;
import org.apache.commons.configuration2.io.XMLConfiguration;
import org.junit.jupiter.api.Test;
import java.io.File;
import java.io.IOException;
import java.nio.file.Files;
import java.nio.file.Path;
import java.util.List;
import static org.junit.jupiter.api.Assertions.assertEquals;

public class ConfigurationTest {

    @Test
    public void testHierarchicalConfigurationWithEmptyValues() throws IOException, ConfigurationException {
        // Step 0: Establish a temporary workspace
        Path workspace = Files.createTempDirectory("config-test");
        File settingsFile = workspace.resolve("settings.xml").toFile();

        // Create a test configuration file with the required structure
        String configContent = "<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n" +
                "<config>\n" +
                "  <key5>\n" +
                "    <example>\n" +
                "      <item></item>\n" +
                "      <item></item>\n" +
                "      <item>value</item>\n" +
                "    </example>\n" +
                "  </key5>\n" +
                "</config>";
        Files.write(settingsFile.toPath(), configContent.getBytes());

        // Step 1: Load the predefined settings document from a file source
        XMLConfiguration config = new XMLConfiguration();
        config.setFile(settingsFile);
        config.load();

        // Step 2: Retrieve the setting located under the nested path 'key5.example'
        HierarchicalConfiguration nestedConfig = config.configurationAt("key5.example");

        // Step 3: Verify that the retrieved setting is a sequence containing two empty text entries followed by the text 'value'
        List<Object> items = nestedConfig.getList("item");
        assertEquals(3, items.size(), "Expected 3 items in the list");
        assertEquals("", items.get(0), "First item should be an empty string");
        assertEquals("", items.get(1), "Second item should be an empty string");
        assertEquals("value", items.get(2), "Third item should be 'value'");

        // Cleanup
        Files.deleteIfExists(settingsFile.toPath());
        Files.deleteIfExists(workspace);
    }
}

